// contracts/Nala.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";

import "./utils/Date.sol";

contract Nala is ERC721URIStorage {
    using Date for date;
    address public host;

    uint public rate;

    uint public totalSupply;

    // Mapping from int(datetime YYYYMMDDHH) to token id
    mapping(uint256 => uint256) private _calendar;

    // inherited URI functionality 

    // mapping(uint256 => string) private _tokenURIs
    // function tokenURI(uint256 tokenId) public view virtual override returns (string memory)

    function scheduledURI(date memory d, uint hour) public view returns (string memory) {
        require(d.isValidDate(), 'Invalid date');
        require(Date.isValidHour(hour), 'Invalid hour');
        uint256 tokenId = _calendar[d.toInt(hour)];
        // special case for tokenId == 0?
        return tokenURI(tokenId);
    }

    function currentURI() public view returns (string memory) {
        (date memory d, uint hour) = Date.timestampToDateHour(block.timestamp);
        return scheduledURI(d, hour);
    }

    constructor(string memory name, string memory symbol, uint _rate, string memory _hostURI) ERC721(name, symbol) {
        rate = _rate;
        host = _msgSender();
        mint(0, host, _hostURI);
    }

    function mint(uint256 tokenId, address recepient, string memory _tokenURI) internal {
       require(tokenId == totalSupply, "Invalid tokenId");
       _safeMint(recepient, tokenId);
       _setTokenURI(tokenId, _tokenURI);
       totalSupply += 1;
    }

    // unused internally - frontend only? 
    function checkHourAvailability(date memory d, uint hour) public view returns (uint256) {
        require(d.isValidDate(), 'Invalid date');
        require(Date.isValidHour(hour), 'Invalid hour');
        return _calendar[d.toInt(hour)];
    }

    // debt: timezone as property of contract (declared in constructor)? 
    // || as input to booking?
    function bookHours(uint256 tokenId, date memory openDate, uint openHour, uint displayHours) internal {
        require(openDate.isValidDate(), 'Invalid date');
        require(Date.isValidHour(openHour), 'Invalid hour');
        require(openDate.timestampFromDateTime(openHour, 0) >= block.timestamp, 'Cannot book time in the past');
        date memory _date = date({year: openDate.year, month: openDate.month, day: openDate.day});
        uint _hour = openHour;
        // there's room for more efficiency with date.toInt conversions unnecessary 
        // each iteration
        while (displayHours > 0) {
           uint _requestedInt = _date.toInt(_hour);
           if (_calendar[_requestedInt] != 0) {
               revert('Unavailable hours.');
           }
           _calendar[_requestedInt] = tokenId;
           (_date, _hour) = _date.incrementHour(_hour);
           displayHours--;
        }
    }

    function book(address guest, date memory openDate, uint openHour, uint displayHours, string memory _tokenURI) public payable {
       require(msg.value == rate * displayHours, "Incorrect amount");
       uint256 tokenId = totalSupply;
       bookHours(tokenId, openDate, openHour, displayHours);
       mint(tokenId, guest, _tokenURI);
    }

    function withdraw(address payable recepient) public {
        require(_msgSender() == host, "Only host can withdraw");
        recepient.transfer(address(this).balance);
    }
}
